  \"2016-11-25T21:06:15.840725\",\n\t\"name\": \"dual-credit-and-exam-based-courses-201011\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Dual Credit and Exam-Based Courses,
  2010-11 (FRSS 104), is a study that is part of the Fast Response Survey System (FRSS)
  program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
  FRSS 104 is a study that provides nationally representative data on prevalence and
  enrollment of dual credit and exam-based courses in public high schools. The study
  was conducted using paper surveys, telephones, and email. In this study school personnel
  were sampled. The unweighted survey response rate was 91 percent and the weighted
  response rate using the initial base weights was also 91 percent. Key statistics
  produced from FRSS 104 were whether students could earn both high school and postsecondary
  credits for the same courses, and if so, the total number of enrollments in these
  courses and the methods of implementation (distance education, at school or at college
  campus and by high school instructor or postsecondary instructor).\",\n\t\"license_title\":
